import logo from './logo.svg';
import './App.css';
function Hearder(){
  return <header>
          <h1><a href="/">WEB</a></h1>
        </header>
}
function Nav(){
  return <nav>
  <ol>
    <li><a href="/read/1">HTML</a></li>
    <li><a href="/read/2">CSS</a></li>
    <li><a href="/read/3">JS</a></li>
  </ol>
</nav>
}
function Article(){
  return <article>
  <h2>Welcome</h2>
  Hello, WEB!
</article>
}
function App() {
  return (
    <div>
      <Hearder></Hearder>
      <Nav></Nav>
      <Article></Article>
    </div>
  );
}

export default App;
